INSERT INTO `reclamo_clasificacioncausa` VALUES (1,'1101','EMITIR RECETAS FARMACOLOGICAS SIN LA DENOMINACION GENERICA INTERNACIONAL, DATOS ERRONEOS O INCOMPLETA','SE CONSIDERA AQUELLOS RECLAMOS RELACIONADOS A LA ENTREGA DE RECETAS EMITIDAS POR EL PROFESIONAL DE SALUD, SIN CONSIGNAR EL NOMBRE GENERICO DEL MEDICAMENTO, CON LETRA ILEGIBLE, INCOMPLETA, ENTRE OTROS.','RECETA CON MEDICAMENTOS DE MARCA Y/O INCOMPLETA Y/O ILEGIBLE.','2021-02-05 21:01:08.482366','2021-02-05 21:01:08.482366',1),(2,'1102','DISPENSAR MEDICAMENTOS Y/O DISPOSITIVOS MEDICOS DE MANERA INSATISFACTORIA','SE CONSIDERAN AQUELLAS RECLAMOS RELACIONADOS A:\r\n- ERROR EN EL TIPO DE PRODUCTOS ENTREGADOS.\r\n- ERROR  EN LACANTIDAD DE PRODUCTOS ENTREGADOS.\r\n- ENTREGA DE PRODUCTOS VENCIDOS, CONTAMINADOS O DETERIORADOS.\r\n- ENTREGA DE PRODUCTOS FALSIFICADOS Y7O SIN REGISTRO SANITARIO, ENTRE OTROS.\r\n- NEGAR O ENTREGAR EN FORMA INCOMPLETA AL USUARIO LA PROVISION DE MEDICAMENTOS O DISPOSITIVOS MÉDICOS','- NO ESTOY SATISFECHO CON LOS MEDICAMENTOS ENTREGADOS.\r\n- NO ME ENTREGARON LOS MEDICAMENTOS.\r\n- ME ENTREGARON DE FORMA INCOMPLETA MIS MEDICAMENTOS','2021-02-05 21:05:14.261411','2021-02-05 21:05:14.261411',1),(3,'1103','DIRECCIONAR AL USUARIO A COMPRAR MEDICAMENTOS O DISPOSITIVOS MEDICOS FUERA DEL ESTABLECIMIENTO DE SALUD','INDUCIR AL USUARIO A COMPRAR DETERMINADOS MEDICAMENTOS O DISPOSITIVOS MÉDICOS FUERA DE LA IPRESS A PESAR DE ESTAR CUBIERTOS O CONTAR CON STOCK EN EL ESTABLECIMIENTO.','ME DICEN QUE COMPRE AFUERA.','2021-02-05 21:07:43.019057','2021-02-05 21:07:43.019057',1),(4,'1104','DIRECCIONAR AL USUARIO A REALIZARSE PROCEDIMIENTOS MEDICOS O QUIRURGICOS FUERA DEL EESS.','INDUCIR AL USUARIO A REALIZARSE PROCEDIMIENTOS MÉDICOS O QUIRÚRGICOS FUERA DEL ESTABLECIMIENTO, PESE A ESTAR CUBIERTOS O DISPONIBLES EN LA IPRESS.','ME DIJERON QUE ME REALICE EL PROCEDIMIENTO AFUERA.','2021-02-05 21:09:40.605400','2021-02-05 21:09:40.605400',1),(5,'1105','NEGAR O CONDICIONAR AL USUARIO A REALIZARSE PROCEDIMIENTOS DE APOYO DIAGNOSTICO','NEGAR AL USUARIO A REALIZARSE PROCEDIMIENTOSDE APOYO AL DIAGNOSTICO.','NO QUIEREN REALIZARME EL PROCEDIMEINTO MEDICO.','2021-02-08 13:33:25.608896','2021-02-08 13:33:25.608896',1),(6,'1106','DEMORAR EN EL OTORGAMIENTO DE CITAS O EN LA ATENCION PARA CONSULTA EXTERNA','SE CONSIDERAN LAS INSATISFACCIONES GENERADAS POR:\r\n- FALTA DE CITAS.\r\n- DISPONIBILIDAD DE CITAS PARA ATENCIÓN EN CONSULTA EXTERNA EN UN PLAZO ALEJADO.\r\n- TIEMPO DE ESPERA PARA LA ATENCIÓN QUE EXCEDE AL TIEMPO ESTABLECIDO POR LA INSTITUCIÓN.','- NO HAY CITAS PARA LA ESPECIALIDAD.\r\n- NO PUEDO CONSEGUIR CITA PARA CONSULTA EXTERNA EN FECHA PROXIMA.\r\n- DEMORAN EN ATENDERME.','2021-02-08 13:35:31.886729','2021-02-08 13:35:31.886729',1),(7,'1107','DEMORA PARA LA HOSPITALIZACION','NO PASE A HOSPITALIZACIÓN O PROGRAMACIÓN HOSPITALARIA POR FALTA DE CUPO, INCLUYE UCI.','NO HAY CAMA DISPONIBLE.','2021-02-08 13:36:50.340640','2021-02-08 13:36:50.340640',1),(8,'1108','DEMORAR EN EL OTORGAMIENTO DE PRESTACIONES DE SALUD DURANTE LA HOSPITALIZACION.','DEMORA PARA EL OTORGAMIENTO DE PRESTACIONES O REALIZACIÓN DE PROCEDIMIENTOS EN EL ÁREA DE HOSPITALIZACIÓN. SE CONSIDERA CUANDO:\r\n- DEMORA EN LA VISITA MÉDICA.\r\n- DEMORA EN LA APLICACIÓN DE MEDICACIÓN.\r\n- DEMORA EN EL CAMBIO DE ROPA DE CAMA.\r\n- DEMORA EN EL ASEO DEL USUARIO.\r\n- DEMORA EN LA REALIZACIÓN DE PROCEDIMIENTOS EN HOSPITALIZACIÓN: CURACIÓN DE HERIDAS, RETIRO DE PUNTOS, CABIO DE APÓSITOS, RETIRO O CAMBIO DE SONDAS, ETC.\r\nNO SE INCLUYE LA DEMORA DE TOMA DE EXAMENES AUXILIARES.','NO ESTOY SATISFECHO CON EL SERVICIO DADO EN HOSPITALIZACIÓN.','2021-02-08 13:37:34.726076','2021-02-08 13:37:34.726076',1),(9,'1109','DEMORAR EN LA ATENCION DE EMERGENCIA DE ACUERDO A LA PRIORIDAD','DEMORA EN EL OTORGAMIENTO DE PRESTACIONES O REALIZACIÓN DE PROCEDIMIENTOS EN EL SERVICIO DE EMERGENCIA, DE ACUERDO A LA PRIORIDAD DEL CASO. SE CONSIDERA:\r\n- DEMORA DE ATENCIÓN EN TRIAJE.\r\n- DEMORA EN LA ATENCIÓN EN TÓPICO DE EMERGENCIA.\r\n- DEMORA EN EL TRASLADO DEL USUARIO A OBSERVACIÓN DE EMERGENCIA.\r\n- DEMORA EN LA ATENCIÓN EN EL ÁREA DE OBSERVACIÓN.\r\n- ENETRE OTRAS ATENCIONES.','DEMORA EN LA ATENCIÓN DE EMERGENCIA.','2021-02-08 13:39:38.323186','2021-02-08 13:39:38.324222',1),(10,'1110','DEMORAR EN LA ATENCION DE PACIENTE OBSTETRICA','DEMORA EN EL OTORGAMIENTO DE PRESTACIONES A PACIENTE OBSTÉTRICA. SE CONSIDERA:\r\n- DEMORA DE ATENCIÓN EN TRIAJE.\r\n- DEMORA EN LA ATENCIÓN EN TÓPICO.\r\n- DEMORA EN LA ATENCIÓN EN EL ÁREA DE OBSERVACIÓN, SALA DE DILATACIÓN O SALA DE PARTO.\r\n- DEMORA EN LA REALIZACIÓN DE CESÁREA INDICADA POR EL MÉDICO TRATANTE.\r\n- OTROS TIPOS DE DEMORA.','DEMORA EN LA ATENCIÓN DE EMERGENCIA A PACIENTE OBSTÉTRICA.','2021-02-08 13:41:49.178838','2021-02-08 13:41:49.178838',1),(11,'1111','DEMORAR EN EL OTORGAMIENTO O REPROGRAMACION DE CUPO PARA PROCEDIMIENTO QUIRURGICO.','DEMORA EN UN PLAZO ALEJADO, EN EL OTROGAMIENTO O REPROGRMACIÓN DE UN CUO PARA REALIZACIÓN DE PROCEDIMIENTO QUIRÚRGICO.','DEMORA EN PROGRAMARME CIRUGIA.','2021-02-08 13:43:03.136959','2021-02-08 13:43:03.136959',1),(12,'1112','NEGAR LA ATENCION EN SITUACIONES DE EMERGENCIA.','NEGAR LAATENCIÓN EN SITUACIONES DE EMERGENCIA Y/O PARTOS, (INCLUYE SERVICIOS QUE SE PRESTAN EN EMERGENCIA SEGÚN NIVEL DE CATEGORIZACIÓN, MEDICAMENTOS Y/O DISPOSITIVOS MÉDICOS) O CONDICIOONAR LA ATENCIÓN A LA PRESENTACIÓN DE DOCUMENTO DE IDENTIDAD, FIRMA DE PAGARÉS, ETC.','NEGAR LA ATENCIÓN DE EMERGENCIA.','2021-02-08 13:45:00.056875','2021-02-08 13:45:00.056875',1),(13,'1113','ENCONTRAR IPRESS Y/O UNIDADES PRESTADORAS DE SERVICIOS E SALUD CERRADAS EN HORARIO DE ATENCION O NO PRESENCIA DEL PERSONAL RESPONSABLE DE LA ATENCION.','FALTA DE DISPONIBILIDAD DE SERVICIOS O PRESTACIONES, SEGÚN DISPOSICIONES OFERTADAS 8DIAS Y HORARIOS) POR PARTE DE LA IPRESS. SE INCLUYEN LA FALTA O AUSENCIA D EPERSONAL DE SALUD PROGRAMADO EN TODOS LOS SERVICIOS QUE RETRASA O IMPIDE LA ATENCIÓN OPORTUNA DEL USUARIO.','IPRESS CERRADA O AUSENCIA DEL PERSONAL DE SALUD RESPONSABLE 