02-08 13:57:46.335699',1),(19,'1119','NO CUENTAN CON VENTANILLA PREFERENCIAL.','NO IMPLEMENTACIÓN DE VENTANILLA PARA LA ATENCIÓN PREFERENCIAL DEL ADULTO MAYOR, GESTANTES Y PERSONAS CON DISCAPACIDAD.','NO CUENTAN CON VENTANILLA PREFERENCIAL.','2021-02-08 13:58:43.662936','2021-02-08 13:58:43.662936',1),(20,'1120','INCUMPLIMIENTO EN LA PROGRAMACION DE CITAS.','- ACUDIR A UNA CITA MÉDICA QUE HA SIDO REPROGRAMADA PARA OTRA FECHA SIN COMUNICACIÓN PREVIA AL PACIENTE.\r\n- ACUDIR A UNA CITA MÉDICA Y EL PROFESIONAL DE LA SALUD NO ACUDIÓ A LABORAR.\r\n- OTROS MOTIVOS AJENOS AL PACIENTE,QUE IMPIDEN EL OTORGAMIENTO DE LA CITA EN FECHA PROGRAMADA.','REPROGRAMACIÓN DE CITA SIN COMUNICACIÓN PREVIA AL PACIENTE.','2021-02-08 13:59:31.286687','2021-02-08 13:59:31.286687',1),(21,'1121','INCUMPLIMIENTO EN LA PROGRAMACION DE INTERVENCIONES QUIRURGICAS.','REAPROGRAMACIÓN DE LA FECHA DE INTERVENCIÓN QUIRÚRGICANPOR MOTIVOS AJENOS AL PACIENTE.','REPROGRAMACIÓN DE INERVENCIÓN QUIRÚRGICA.','2021-02-08 14:00:26.885882','2021-02-08 14:00:26.885882',1),(22,'1201','NO BRINDAR INFORMACION DE LOS PROCESOS ADMINISTRATIVOS DE LA IPRESS.','FALTA O ENTREGA< INSATISFACTORIA DE INFORMACIÓN SOBRE:\r\n- NORMAS, REGLAMENTOS O CONDICIONES ADMINISTRATIVAS VINVULADAS A LA ATENIÓN.\r\n- GASTOS CUBIERTOS EN LA PRESTRACIÓN DE SALUD ASÍ COMO LAS CONDICIONES DEL PLAN DE ATENCIÓN EN SALUD, CUANDO EL USUARIO O PERSONAL ADMINSITRATIVO LO SOLICITE.\r\n- ENTRE OTROS.','NO ME DIERON INFORMACIÓN CLARA SOBRE:\r\n- ASUNTOS ADMINISTRATIVOS\r\n- TRATAMIENTO\r\n- GASTOS NO CUBIERTOS\r\n- EL MÉDICO TRATANTE\r\n- MIS DERECHOS','2021-02-08 14:03:20.732286','2021-02-08 14:03:20.732286',2),(23,'1203','NO RECIBIR DE SU MEDICO Y/O PERSONAL DE SALUD TRATANTE, INFORMACION COMPRENSIBLE SOBRE SU ESTADO DE SALUD O TRATAMIENTO.','SE CONSIDERA AQUELLOS RECLAMOS EN EL QUE EL PROFESIONAL DE LA SALUD INFORMA DE MANERA INSATISFACTORIA O SE REHUSA A BRINDAR INFROMACIÓN AL USUARIO ACERCA DEL ESTADO DE SALUD Y/O DEL TRATAMIENTO QUE VIENE RECIBIEN