UMENTOS RELACIONADOS A SU ATENCIÓN, ASÍ COMO RESGUARDAR LA PRIVACIDAD DE LA INFORMACIÓN.','ACCESO A LA HC Y LOS OTROS REGISTROS CLÍNICOS.','2021-02-08 14:33:00.680414','2021-02-08 14:33:00.680414',5),(34,'1502','NO REALIZAR LA GESTION DEL RECLAMO DE FORMA OPORTUNA Y ADECUADA.','SE CONSIDERAN AQUELLOS RECLAMOS DONDE LA IPRESS:\r\n- NO BRINDA INFORMCIÓN AL USUARIO SOBRE LA GESTIÓN DEL RECLAMOSEN EL PLAZO ESTABLECIDO SEGÚN NORMATIVA.\r\n- NO TRASLADA OPORTUNAMENTE EL RECLAMO A LA INSTANCIA CON COMPETENCIA.\r\n- NO TRAMITA EL RECLAMO DENTRO DE LOS PLAZOS ESTABLECIDOS.\r\n- DEMORA O NEGATIVA EN BRINDAR EL LIBRO DE RECLAMACIONES.\r\n- ENTRE OTROS.','GESTIÓN DEL RECLAMO:\r\n- NO ME DAN INFORMACIÓN.\r\n- OBSTACULIZAR.\r\n- DEMORA EN ELPLAZO ESTABLECIDO.','2021-02-08 14:34:22.327946','2021-02-08 14:34:22.327946',5),(35,'1504','NO CONTAR CON PLATAFORMA DE ATENCION AL USUARIO EN SALUD DE ACUERDO A LA NORMATIVIDAD VIGENTE.','NO CONTAR CON UNA PLATAFORMA DE ATENCIÓN AL USURIO EN SALUD PARA LA ATENCIÓN DE CONSULTAS Y RECLAMOS DE ACUERDO A LA NORMATIVIDAD VIGENTE.','NO TIENE PAUS','2021-02-08 14:35:27.764895','2021-02-08 14:35:27.764895',5),(36,'2001','OTROS RELATIVOS A LA ATENCION DE SALUD EN LAS IPRESS.','OTRO RECLAMOS REFERIDOS A LA ATENCIÓN EN LA IPRESS O UGIPRESS.','OTROS RECLAMOS NO IDENTIFICADOS.','2021-02-08 14:36:20.564882','2021-02-08 14:36:20.564882',6),(37,'9999','POR DEFECTO','POR DEFECTO','POR DEFECTO','2022-11-30 05:59:45.538134','2022-11-30 05:59:45.538179',6);
